full_text:
@bob_rylander @Annabosdotter @GreiderDD Inte säkert att publiciteten runt Adaktussons 22 knapptryckningar gynnade KD i EU-valet - hade nog gått bättre utan den

Håller med dej f ö - minaretupproret, helgskinkan, 
100 000 våldtäkter mm har nog mer funkat som uppmärksamhetsdjippon a la Trump.

Men inte så konstigt att EU-valet blev ett nytt jätteras för Socialdemokraterna i Sollefteå kommun: minus 938 röster, 13 procent. Dock orsakas det inte av partiet lokalt utan i länet/regionen (landstinget).
Länets S-riksdagslista toppades av Löfven.
@socialdemokrat

@politiskanalys @DSuhonen ”Riksdagsvalet 2018 var enligt Stefan Löfven en folkomröstning om välfärden.
Som S förlorade. EU-valet var enligt Stefan Löfven en folkomröstning om demokratin. Som S förlorade. Att någon skulle ta något som helst ansvar för detta är naturligtvis otänkbart.”

Hej då S.

@juanitafranden Resultat EU-valet:

2014: KD: 5,93% 
2019: KD: 8,7%

@SBomrud Här går jag bet. Vill dock minnas att någon man några dagar före EU-valet skrev att han skulle lägga ned sin Twitter precis efter valet.
Kanske var det han? 🤔
Partikamrat?
